import React from 'react';
import svgSprite from '../../assets/img/svg-sprite.svg'
import {IconWrapper} from "../../layout/sections/skills/skill/skill";


type IconPropsType = {
    iconId: string,
    width?: string,
    height?: string,
    viewBox?: string
    style?: string
}


export const Icon = (props: IconPropsType) => {
    return (
        <IconWrapper>
        <svg  width={props.width}  height={props.height} viewBox={props.viewBox || '0 0 200 200'} fill="none" xmlns="http://www.w3.org/2000/svg">
            <use xlinkHref={`${svgSprite}#${props.iconId}`} />
        </svg>
        </IconWrapper>
    );
};
